import React, { Component } from 'react';
import Todos from "./Todos/Todos";
import Posts from "./Posts/Posts";

class MainTasks extends Component {
    constructor(props){
        super(props);
        this.state={objData:''}
    }




    render() {
        return (
            <div className="MainTasks">
                    <Todos/>
                    <Posts/>
            </div>
        );
    }
}

export default MainTasks;
